import React from "react";
import "./home.css";

import HeaderHome from "./headerHome/HeaderHome";

function HasNoCollection(props) {
  console.log(props.data);
  return (
    <div className="HasNoCollection">
      <div className="content">
        <div className="title">You have no collections.</div>

        <div className="collections">
          {props.data.map((collection) => {
            <div className="collection">
              <div className="collection__tag"
              style={{
                
              }}>
                <ion-icon name="bowling-ball-outline"></ion-icon>
              </div>
              <div className="collection__details">
                <div className="collection__name">jksdfhsdjfsdh</div>
                <div className="collection__count-tasks">No tasks</div>
              </div>
            </div>;
          })}
          <button className="addCollection button btn--border btn--hover-bg-gray">
            Add Your First Collection
          </button>
        </div>
      </div>
    </div>
  );
}

export default function Home() {
  let collections = [
    { cId: 1, cName: "abc", cColor: "red" },
    { cId: 2, cName: "abc", cColor: "red" },
    { cId: 3, cName: "abc", cColor: "red" },
    { cId: 4, cName: "abc", cColor: "red" },
    { cId: 5, cName: "abc", cColor: "red" },
    { cId: 6, cName: "abc", cColor: "red" },
  ];
  return (
    <div className="Home">
      <HeaderHome />
      <div className="content">
        <HasNoCollection data={collections} />
      </div>
    </div>
  );
}
